package id.co.aio.procure_to_pay.sap_master;

/*This is a Studio Managed File. DO NOT EDIT THIS FILE. Your changes may be reverted by Studio.*/

import java.io.Serializable;
import java.util.Objects;

public class SkatId implements Serializable {

    private String saknr;
    private String ktopl;

    public String getSaknr() {
        return this.saknr;
    }

    public void setSaknr(String saknr) {
        this.saknr = saknr;
    }

    public String getKtopl() {
        return this.ktopl;
    }

    public void setKtopl(String ktopl) {
        this.ktopl = ktopl;
    }

    @Override
    public boolean equals(Object o) {
        if (this == o) return true;
        if (!(o instanceof Skat)) return false;
        final Skat skat = (Skat) o;
        return Objects.equals(getSaknr(), skat.getSaknr()) &&
                Objects.equals(getKtopl(), skat.getKtopl());
    }

    @Override
    public int hashCode() {
        return Objects.hash(getSaknr(),
                getKtopl());
    }
}